import { Component } from '@angular/core';

@Component({
  selector: 'app-java-script-behavior',
  templateUrl: './java-script-behavior.component.html',
  styleUrls: ['./java-script-behavior.component.scss']
})

export class JavaScriptBehaviorComponent {

  public active = "home";

}
